-- ----------------------------
-- Table structure for `shwap_admins`
-- ----------------------------
DROP TABLE IF EXISTS `shwap_admins`;
CREATE TABLE `shwap_admins` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '管理员id',
  `username` varchar(100) DEFAULT NULL COMMENT '管理员用户名',
  `password` varchar(100) DEFAULT NULL COMMENT '管理员密码',
  `status` smallint(6) DEFAULT NULL COMMENT '管理员当前状态：1代表：启用，0代表：禁用',
  `ip` varchar(100) DEFAULT NULL COMMENT '管理员登录ip',
  `login_time` varchar(32) DEFAULT NULL COMMENT '登录时间',
  `create_time` varchar(32) DEFAULT NULL COMMENT '注册时间',
  `login_num` int(11) DEFAULT '0' COMMENT '登录次数',
  `save_time` varchar(32) DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8;

