-- ----------------------------
-- Table structure for `shwap_article`
-- ----------------------------
DROP TABLE IF EXISTS `shwap_article`;
CREATE TABLE `shwap_article` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'id',
  `title` varchar(100) DEFAULT NULL COMMENT '文章标题',
  `description` varchar(255) DEFAULT NULL COMMENT '文章描述',
  `img` varchar(200) DEFAULT NULL COMMENT '文章图片',
  `status` smallint(6) DEFAULT NULL COMMENT '文章类型：1：健康体检，2：影像检查，3：专家，4：尖端设备，5：体检须知，6：加入我们,',
  `doc_job_one` varchar(100) DEFAULT NULL COMMENT '专家职称1',
  `doc_job_two` varchar(100) DEFAULT NULL COMMENT '专家职称2',
  `shebei_title` varchar(100) DEFAULT NULL COMMENT '设备名称1',
  `create_time` varchar(32) DEFAULT NULL COMMENT '文章创建时间',
  `ip` varchar(32) DEFAULT NULL COMMENT '文章创建ip',
  `click` mediumint(11) unsigned NOT NULL DEFAULT '0' COMMENT '文章点击数',
  `content` text COMMENT '文章内容',
  `sort` int(11) DEFAULT '0' COMMENT '排序',
  `display` smallint(6) DEFAULT NULL COMMENT '是否显示： 1：显示， 0：隐藏',
  `author` varchar(100) DEFAULT NULL COMMENT '作者',
  `pnan` varchar(20) DEFAULT NULL COMMENT '价格',
  `pyhnv` varchar(20) DEFAULT NULL,
  `pwhnv` varchar(20) DEFAULT NULL,
  `pnv` varchar(20) DEFAULT NULL,
  `orderID` smallint(10) DEFAULT NULL COMMENT '方案id',
  `save_time` varchar(32) DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=40 DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of shwap_article
-- ----------------------------

