DROP TABLE IF EXISTS `shwap_banner`;
CREATE TABLE `shwap_banner` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `title` varchar(200) DEFAULT NULL COMMENT '广告标题',
  `shorttitle` varchar(200) DEFAULT NULL COMMENT '副标题',
  `img` varchar(255) DEFAULT NULL COMMENT '广告图片',
  `create_time` varchar(32) DEFAULT NULL COMMENT '广告创建时间',
  `status` smallint(6) DEFAULT NULL COMMENT '广告状态：1为：banner, 0为：其它图片',
  `sort` int(11) DEFAULT NULL COMMENT '广告排序',
  `arcurl` varchar(200) DEFAULT NULL COMMENT '对应文章链接',
  `display` smallint(6) DEFAULT NULL COMMENT '是否显示隐藏，1：显示，0：隐藏',
  `author` varchar(200) DEFAULT NULL,
  `save_time` varchar(32) DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=11 DEFAULT CHARSET=utf8;

