INSERT INTO `shwap_article` VALUES ('6', '超声医师', null, null, '6', null, null, null, '1524894750', null, '0', '<p><strong style=\"font-family: &quot;sans serif&quot;, tahoma, verdana, helvetica; white-space: normal;\"><span style=\"font-size: 16px; line-height: 1.5;\">职位名称：超声医师</span></strong><br style=\"font-family: &quot;sans serif&quot;, tahoma, verdana, helvetica; white-space: normal;\"/><strong style=\"font-family: &quot;sans serif&quot;, tahoma, verdana, helvetica; white-space: normal;\"><span style=\"font-size: 16px; line-height: 1.5;\">职位描迹：</span></strong><br style=\"font-family: &quot;sans serif&quot;, tahoma, verdana, helvetica; white-space: normal;\"/><span style=\"font-family: &quot;sans serif&quot;, tahoma, verdana, helvetica; font-size: 16px; line-height: 1.5;\">1、体检所需的超声诊断工作,确保超声检查结果准确、及时和科学；</span><br style=\"font-family: &quot;sans serif&quot;, tahoma, verdana, helvetica; white-space: normal;\"/><span style=\"font-family: &quot;sans serif&quot;, tahoma, verdana, helvetica; font-size: 16px; line-height: 1.5;\">2、熟悉超声仪器原理与结构,掌握仪器正确调节使用丶日常保养；</span><br style=\"font-family: &quot;sans serif&quot;, tahoma, verdana, helvetica; white-space: normal;\"/><span style=\"font-family: &quot;sans serif&quot;, tahoma, verdana, helvetica; font-size: 16px; line-height: 1.5;\">3、女性2名,1名以四维超声为主,1名以乳腺丶小器官超声为主；</span><br style=\"font-family: &quot;sans serif&quot;, tahoma, verdana, helvetica; white-space: normal;\"/><span style=\"font-family: &quot;sans serif&quot;, tahoma, verdana, helvetica; font-size: 16px; line-height: 1.5;\">4、男性2名,1名以心脏超声为主,1名以小器官、体表超声为主；</span><br style=\"font-family: &quot;sans serif&quot;, tahoma, verdana, helvetica; white-space: normal;\"/><span style=\"font-family: &quot;sans serif&quot;, tahoma, verdana, helvetica; font-size: 16px; line-height: 1.5;\">5、影像学相关专业,主治医师及以上。</span><br style=\"font-family: &quot;sans serif&quot;, tahoma, verdana, helvetica; white-space: normal;\"/><br style=\"font-family: &quot;sans serif&quot;, tahoma, verdana, he