na, helvetica; text-align: justify; font-size: 16px; line-height: 1.5;\"><strong style=\"white-space: normal; font-family: &quot;sans serif&quot;, tahoma, verdana, helvetica; text-align: justify;\"><span style=\"font-size: 16px; line-height: 1.5;\">岗位人数：1人</span></strong></span></p>', '7', null, 'xiaorun@uvclinic.cn', null, null, null, null, null, null);
