ily: &quot;sans serif&quot;, tahoma, verdana, helvetica; text-align: justify; font-size: 16px; line-height: 1.5;\">&nbsp;</span><br style=\"font-family: &quot;sans serif&quot;, tahoma, verdana, helvetica; text-align: justify; white-space: normal;\"/><strong style=\"font-family: &quot;sans serif&quot;, tahoma, verdana, helvetica; text-align: justify; white-space: normal;\"><span style=\"font-size: 16px; line-height: 1.5;\">任职资格：</span></strong><br style=\"font-family: &quot;sans serif&quot;, tahoma, verdana, helvetica; text-align: justify; white-space: normal;\"/><span style=\"font-family: &quot;sans serif&quot;, tahoma, verdana, helvetica; text-align: justify; font-size: 16px; line-height: 1.5;\">1、专业要求:妇科专业；</span><br style=\"font-family: &quot;sans serif&quot;, tahoma, verdana, helvetica; text-align: justify; white-space: normal;\"/><span style=\"font-family: &quot;sans serif&quot;, tahoma, verdana, helvetica; text-align: justify; font-size: 16px; line-height: 1.5;\">2、经验要求:主治及以上职称,五年以上工作经验,有医师资格证书、医师执业证及专业技术职务证书；</span><br style=\"font-family: &quot;sans serif&quot;, tahoma, verdana, helvetica; text-align: justify; white-space: normal;\"/><span style=\"font-family: &quot;sans serif&quot;, tahoma, verdana, helvetica; text-align: justify; font-size: 16px; line-height: 1.5;\">3、学历要求:大专及以上。</span></p>', '8', null, 'xiaorun@uvclinic.cn', null, null, null, null, null, null);
