INSERT INTO `shwap_article` VALUES ('20', 'PET/MR检查', '目前全球最尖端的用于肿瘤筛查的医学影像设备', '20180528/ae09da6fbd4e90e42617de7db469946e.jpg', '2', null, null, null, '1524907313', null, '1', '<p style=\"word-wrap: break-word;font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;white-space: normal\"><strong><span style=\"color: rgb(51, 51, 51);font-size: 14px\"><strong>PET/MR(</strong></span><span style=\"color: rgb(51, 51, 51);font-size: 14px\"><strong>研究型</strong></span><span style=\"color: rgb(51, 51, 51);font-size: 14px\"><strong>)&nbsp;</strong></span><span style=\"font-size: 14px\"><strong><span style=\"color: rgb(51, 51, 51)\">是全球公认的在恶性肿瘤、神经系统疾病的早期筛查和诊断上最有效的医学影像设备之一。</span><span style=\"color: rgb(51, 51, 51)\"><strong>PET/MR</strong></span><span style=\"color: rgb(51, 51, 51)\"><strong>（研究型）将两次检查——正电子扫描（</strong></span><span style=\"color: rgb(51, 51, 51)\"><strong>PET</strong></span><span style=\"color: rgb(51, 51, 51)\"><strong>）和磁极共振照影术（</strong></span><span style=\"color: rgb(51, 51, 51)\"><strong>MR</strong></span><span style=\"color: rgb(51, 51, 51)\"><strong>），合并为一次，可缩短检查时间，同时获取全身</strong></span><span style=\"color: rgb(51, 51, 51)\"><strong>MR</strong></span><span style=\"color: rgb(51, 51, 51)\"><strong>和</strong></span><span style=\"color: rgb(51, 51, 51)\"><strong>PET</strong></span><strong><span style=\"color: rgb(51, 51, 51)\">数据，是医学成像领域的巨大飞跃，为诊断和了解疾病开启了新的大门。它在临床医学的应用主要集中于恶性肿瘤、神经系统、心血管系统三大领域。</span></strong></strong></span></strong></p><p style=\"word-wrap: break-word;font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;white-space: normal\"><strong><span style=\"font-size: 16px;color: rgb(51, 127, 229)\">设备优势</span></strong></p><p style=\"word-wrap: break-word;font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;white-space: normal\"><strong><span style=\"color: rgb(51, 51, 51);font-size: 14px\"><strong>1</strong></span><span style=\"color: rgb(51, 51, 51);font-size: 14px\"><strong>、强大的查体功能</strong></span></strong></p><p style=\"word-wrap: break-word;font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;white-space: normal\"><span style=\"color: rgb(51, 51, 51);font-size: 14px\">可早期筛查出</span><span style=\"color: rgb(51, 51, 51);font-size: 14px\">2mm</span><span style=\"color: rgb(51, 51, 51);font-size: 14px\">以上癌症病变和其他重大疾病；全身一次检查便可发现全身是否存在危险的微小病灶。早期诊断可以使患者能够真正的得到早期治疗并为彻底治愈创造了条件，定期的</span><span style=\"color: rgb(51, 51, 51);font-size: 14px\">PET/MR</span><span style=\"color: rgb(51, 51, 51);font-size: 14px\">健康检查可发现一些无症状的早期疾病。</span></p><p style=\"word-wrap: break-word;font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;white-space: normal\"><strong><span style=\"color: rgb(51, 51, 51);font-size: 14px\"><strong>2</strong></span><span style=\"color: rgb(51, 51, 51);font-size: 14px\"><strong>、舒适的检查体验</strong></span></strong></p><p style=\"word-wrap: break-word;font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;white-space: normal\"><span style=\"font-size: 14px\"><span style=\"color: rgb(51, 51, 51)\">检查时间降低到分体式设备的一半，更好的舒适体验。</span><span style=\"color: rgb(51, 51, 51)\">扫描速度快，图像质量高。</span></span></p><p style=\"word-wrap: break-word;font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;white-space: normal\"><strong><span style=\"color: rgb(51, 51, 51);font-size: 14px\"><strong>3</strong></span><span style=\"color: rgb(51, 51, 51);font-size: 14px\"><strong>、人性化设计的完善</strong></span></strong></p><p style=\"word-wrap: break-word;font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;white-space: normal\"><span style=\"color: rgb(51, 51, 51);font-size: 14px\">超大孔径和降噪设计，提升受检时的舒适感。</span></p><p style=\"word-wrap: break-word;font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;white-space: normal\"><strong><span style=\"color: rgb(51, 51, 51);font-size: 14px\"><strong>4</strong></span><span style=\"color: rgb(51, 51, 51);font-size: 14px\"><strong>、绿色健康的新技术</strong></span></strong></p><p style=\"word-wrap: break-word;font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;white-space: normal\"><span style=\"font-size: 14px\"><span style=\"color: rgb(51, 51, 51)\">相比PET/CT检查，可减少80%以上的辐射量。检查大幅度减低了放射线对人体的损伤，因为MR对人体无任何放射损伤。因此，PET/MR是最佳的体检和诊断设备，</span><span style=\"color: rgb(51, 51, 51)\">可以完全放心地应用于健康人群体检。</span></span></p><p><strong style=\"font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;white-space: normal\"></strong></p><p style=\"word-wrap: break-word;font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;white-space: normal\"><strong><span style=\"font-size: 16px;color: rgb(51, 127, 229)\">临床应用</span></strong></p><p style=\"word-wrap: break-word;font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;white-space: normal\"><span style=\"color: rgb(51, 51, 51);font-size: 14px\">神经系统、头颈部、胸部、乳腺、肝胆胰脾、结直肠、生殖系统、血液系统、骨关节系统、不明原因原发灶肿瘤治疗前检查、不明原因发热，感染和炎症性疾病的诊疗指导、儿童检查。</span></p><p><span style=\"color: rgb(51, 51, 51);font-size: 14px\"><br/></span></p><p><br/></p>', '1', '1', 'xiaorun@uvclinic.cn', null, null, null, null, '8', '1527498188');
INSERT INTO `shwap_article` VALUES ('21', 'PET/CT检查', '应用于肿瘤诊断，分期，疗效评估及预后的', '20180528/525f598ec50ac2abec7c26ac1402e5de.jpg', '2', null, null, null, '1524907778', null, '0', '<p style=\"word-wrap: break-word;font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;white-space: normal\"><strong><strong><strong><span style=\"font-size: 14px;color: rgb(51, 51, 51)\">PET/CT</span><span style=\"font-size: 14px;color: rgb(51, 51, 51)\">将</span><span style=\"font-size: 14px;color: rgb(51, 51, 51)\">PET</span><span style=\"font-size: 14px;color: rgb(51, 51, 51)\">与</span><span style=\"font-size: 14px;color: rgb(51, 51, 51)\">CT</span><span style=\"font-size: 14px;color: rgb(51, 51, 51)\">完美融为一体，由</span><span style=\"font-size: 14px;color: rgb(51, 51, 51)\">PET</span><span style=\"font-size: 14px;color: rgb(51, 51, 51)\">提供病灶详尽的功能与代谢等分子信息，而</span><span style=\"font-size: 14px;color: rgb(51, 51, 51)\">CT</span><span style=\"font-size: 14px;color: rgb(51, 51, 51)\">提供病灶的精确解剖定位，一次显像可获得全身各方位的断层图像，具有灵敏、准确、特异及定位精确等特点，可一目了然地了解全身整体状况，达到早期发现病灶和诊断疾病的目的。对肿瘤的早期发现、良恶性肿瘤的鉴别诊断、术前分期评估、术后复查有否复发及转移、放化疗等治疗手段疗效的评估等有着非常明显的优势。</span></strong></strong></strong></p><p style=\"word-wrap: break-word;font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;white-space: normal\"><strong><strong><strong><strong><span style=\"font-size: 16px;color: rgb(51, 127, 229)\">设备优势</span></strong></strong></strong></strong></p><p style=\"word-wrap: break-word;font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;white-space: normal\"><strong><strong><strong><strong><span style=\"font-size: 14px;color: rgb(51, 51, 51)\">1</span></strong><strong><span style=\"font-size: 14px;color: rgb(51, 51, 51)\">、能早期诊断肿瘤等疾病</span></strong></strong></strong></strong></p><p style=\"word-wrap: break-word;font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;white-space: normal\"><span style=\"font-size: 14px;color: rgb(51, 51, 51)\">由于肿瘤细胞代谢活跃，摄取显像剂能力为正常细胞的</span><span style=\"font-size: 14px;color: rgb(51, 51, 51)\">2-10</span><span style=\"font-size: 14px;color: rgb(51, 51, 51)\">倍，形成图像上明显的“光点”，因此在肿瘤早期即能发现隐匿的微小病灶（大于</span><span style=\"font-size: 14px;color: rgb(51, 51, 51)\">2mm</span><span style=\"font-size: 14px;color: rgb(51, 51, 51)\">），对各类肿瘤灵敏度高。对良恶性肿瘤的早期发现、鉴别诊断，对转移瘤的早期发现有着非常明显的优势。</span></p><p style=\"word-wrap: break-word;font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;white-space: normal\"><strong><strong><strong><strong><span style=\"font-size: 14px;color: rgb(51, 51, 51)\">2</span></strong><strong><span style=\"font-size: 14px;color: rgb(51, 51, 51)\">、检查结果更精准</span></strong></strong></strong></strong></p><p style=\"word-wrap: break-word;font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;white-space: normal\"><span style=\"font-size: 14px;color: rgb(51, 51, 51)\">通过定性和定量分析，能提供有价值的功能和代谢方面的信息，同时提供精确的解剖信息，能帮助确定和查找肿瘤的精确位置，其检查结果比单独的</span><span style=\"font-size: 14px;color: rgb(51, 51, 51)\">PET</span><span style=\"font-size: 14px;color: rgb(51, 51, 51)\">或</span><span style=\"font-size: 14px;color: rgb(51, 51, 51)\">CT</span><span style=\"font-size: 14px;color: rgb(51, 51, 51)\">有更高的准确性，特别是显著提高了对小病灶的诊断能力。</span></p><p style=\"word-wrap: break-word;font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;white-space: normal\"><strong><strong><strong><strong><span style=\"font-size: 14px;color: rgb(51, 51, 51)\">3</span></strong><strong><span style=\"font-size: 14px;color: rgb(51, 51, 51)\">、进行全身快速检查</span></strong></strong></strong></strong></p><p style=\"word-wrap: break-word;font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;white-space: normal\"><span style=\"font-size: 14px;color: rgb(51, 51, 51)\">其它影像学检查是对选定的身体某些部位进行扫描，而</span><span style=\"font-size: 14px;color: rgb(51, 51, 51)\">PET/CT</span><span style=\"font-size: 14px;color: rgb(51, 51, 51)\">一次全身扫描仅需近</span><span style=\"font-size: 14px;color: rgb(51, 51, 51)\">10</span><span style=\"font-size: 14px;color: rgb(51, 51, 51)\">分钟左右，能分别获得</span><span style=\"font-size: 14px;color: rgb(51, 51, 51)\">PET</span><span style=\"font-size: 14px;color: rgb(51, 51, 51)\">、</span><span style=\"font-size: 14px;color: rgb(51, 51, 51)\">CT</span><span style=\"font-size: 14px;color: rgb(51, 51, 51)\">及两者融合的全身横断面、矢状面和冠状面图像，可直观地看到疾病在全身的受累部位及情况。</span></p><p style=\"word-wrap: break-word;font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;white-space: normal\"><strong><strong><strong><strong><span style=\"font-size: 14px;color: rgb(51, 51, 51)\">4</span></strong><strong><span style=\"font-size: 14px;color: rgb(51, 51, 51)\">、检查安全无创</span></strong></strong></strong></strong></p><p style=\"word-wrap: break-word;font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;white-space: normal\"><span style=\"font-size: 14px;color: rgb(51, 51, 51)\">整个检查过程无创、无痛，安全可靠。</span></p><p style=\"word-wrap: break-word;font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;white-space: normal\"><strong><strong><strong><strong><span style=\"font-size: 14px;color: rgb(51, 51, 51)\">5</span></strong><strong><span style=\"font-size: 14px;color: rgb(51, 51, 51)\">、更好的舒适体验</span></strong></strong></strong></strong></p><p style=\"word-wrap: break-word;font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;white-space: normal\"><span style=\"font-size: 14px;color: rgb(51, 51, 51)\">可满足大体型受检者的需要。</span></p><p style=\"word-wrap: break-word;font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;white-space: normal\"><span style=\"font-size: 16px\"><span style=\"color: rgb(51, 127, 229)\"><strong>临床应用</strong></span></span></p><p style=\"word-wrap: break-word;font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;white-space: normal\"><span style=\"font-size: 14px\">肿瘤的早期诊断和鉴别诊断、</span><span style=\"font-size: 14px\">神经系统、</span><span style=\"font-size: 14px\">心脑血管系统、</span><span style=\"font-size: 14px\">感染病灶的研究中表现明显</span><span style=\"font-size: 14px\">、</span><span style=\"font-size: 14px\">亚健康肿瘤筛查的最佳手段、</span><span style=\"font-size: 14px\">进行很好的疗效评估。</span></p><p><span style=\"font-size: 14px\"><br/></span></p><p><br/></p>', '2', '1', 'xiaorun@uvclinic.cn', null, null, null, null, '7', null);
INSERT INTO `shwap_article` VALUES ('22', 'MR 检查', '对各脏器器官疾病有绝佳的诊断功能，也使恶心肿瘤、心脏及脑血管疾病无所遁形', '20180528/632c9bfd36eaf47b61b5a638b78aa35e.jpg', '2', null, null, null, '1524907977', null, '0', '<p style=\"word-wrap: break-word;font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;white-space: normal\"><strong><span style=\"color: rgb(51, 51, 51);font-size: 14px\">磁共振成像具有无射线、成像参数多、多方位成像，不用对比剂可进行血管或水成像，在脑、脊髓、椎间盘检查中具有不可取代的优势，骨关节系统显示病变敏感，软骨及软组织分辨好等特点。对颅脑、甲状腺、乳腺、肝、胆、胰、脾、肾、肾上腺、子宫、卵巢、前列腺、脊柱脊髓等器官的疾病有绝佳的诊断功能，也使恶性肿瘤、心脏及脑血管疾病无所遁形。</span></strong></p><p style=\"word-wrap: break-word;font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;white-space: normal\"><strong><span style=\"color: rgb(51, 127, 229);font-size: 16px\">设备优势</span></strong></p><p style=\"word-wrap: break-word;font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;white-space: normal\"><span style=\"color: rgb(51, 51, 51);font-size: 14px\">磁共振成像具有无射线、成像参数多、多方位成像，不用对比剂可进行血管或水成像，在脑、脊髓、椎间盘检查中具有不可取代的优势，骨关节系统显示病变敏感，软骨及软组织分辨好等特点。</span></p><p style=\"word-wrap: break-word;font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;white-space: normal\"><strong><span style=\"color: rgb(51, 127, 229);font-size: 16px\">临床应用</span></strong></p><p style=\"word-wrap: break-word;font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;white-space: normal\"><span style=\"font-size: 14px;color: rgb(51, 51, 51)\">中枢神经系统病变、</span><span style=\"font-size: 14px;color: rgb(51, 51, 51)\">乳腺肿瘤、</span><span style=\"font-size: 14px;color: rgb(51, 51, 51)\">腹部器官、</span><span style=\"font-size: 14px;color: rgb(51, 51, 51)\">肾脏、</span><span style=\"font-size: 14px;color: rgb(51, 51, 51)\">盆腔、</span><span style=\"font-size: 14px;color: rgb(51, 51, 51)\">骨与关节。</span></p><p><br/></p>', '3', '1', 'xiaorun@uvclinic.cn', null, null, null, null, '23', null);
INSERT INTO `shwap_article` VALUES ('23', 'CT 检查', '用于心脑血管系统疾病的筛查，无需控制心率既能获得高质量的图像', '20180528/fe244746df2a2ca2fd76b29337577c97.jpg', '2', null, null, null, '1524908015', null, '1', '<p><strong style=\"font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;white-space: normal\"><p style=\"word-wrap: break-word\"><strong><span style=\"color: rgb(51, 51, 51);font-size: 14px\">双源CT是目前世界上最先进的CT设备之一，其扫描速度更快；辐射剂量极低（小于1mSV）；图像质量高，不受呼吸运动的影响；4D动态800排大螺距扫描，实现大范围的动脉灌注功能成像；双能扫描纯谱等独具匠心的技术优势，使其在临床上的应用如雨后春笋、方兴未艾！</span></strong><strong><strong><span style=\"color: rgb(51, 51, 51);font-size: 14px\">低剂量CT具备专用于肺部平扫的低剂量扫描方案：胸片的剂量就可以获得超高分辨率的肺部</span><span style=\"color: rgb(51, 51, 51);font-size: 14px\">CT</span><span style=\"color: rgb(51, 51, 51);font-size: 14px\">图像。</span></strong></strong></p><p style=\"word-wrap: break-word\"><span style=\"color: rgb(51, 127, 229);font-size: 16px\"><strong>双源CT 设备优势</strong></span></p><p style=\"word-wrap: break-word\"><span style=\"font-size: 14px\"><strong><span style=\"color: rgb(51, 51, 51);font-weight:bold;background-color:#EEEEEE\">1、扫描速度快</span><br/></strong></span></p><p style=\"word-wrap: break-word\"><span style=\"color: rgb(51, 51, 51);background-color:#EEEEEE\">心脏扫描只需0.25秒(业界最快)，速度提高20倍；全胸扫描仅需0.6秒，速度提高近30倍；1.8米全身扫描只需4秒。</span></p><p style=\"word-wrap: break-word\"><span style=\"color: rgb(51, 51, 51);font-weight:bold;background-color:#EEEEEE\"><strong>2、纯谱双能</strong></span><span style=\"font-size: 14px;color: rgb(51, 51, 51)\"></span></p><p style=\"word-wrap: break-word\"><span style=\"font-size: 14px;color: rgb(51, 51, 51)\"><span style=\"color: rgb(103, 103, 103);background-color:#EEEEEE\">组织鉴别能力显著增强，图像更清晰，检查更全面仔细，能及早发现细微的病变。</span></span></p><p style=\"word-wrap: break-word\"><span style=\"font-size: 14px;color: rgb(51, 51, 51)\"><span style=\"color: rgb(103, 103, 103);background-color:#EEEEEE\"><span style=\"color: rgb(51, 51, 51);font-weight:bold;background-color:#EEEEEE\"><strong>3、4D扫描</strong></span><span style=\"color: rgb(51, 51, 51)\"></span><br/></span></span></p><p style=\"word-wrap: break-word\"><span style=\"font-size: 14px;color: rgb(51, 51, 51)\"><span style=\"color: rgb(103, 103, 103);background-color:#EEEEEE\"><span style=\"color: rgb(51, 51, 51)\"><span style=\"color: rgb(103, 103, 103)\">动态800排，覆盖48CM的4D扫描范围，实现动态血流成像。</span></span></span></span></p><p style=\"word-wrap: break-word\"><span style=\"font-size: 14px;color: rgb(51, 51, 51)\"><span style=\"color: rgb(103, 103, 103);background-color:#EEEEEE\"><span style=\"color: rgb(51, 51, 51)\"><span style=\";font-weight:bold;background-color:#EEEEEE\"><strong>4、绿色安全</strong></span><br/></span></span></span></p><p style=\"word-wrap: break-word\"><span style=\"font-size: 14px;color: rgb(51, 51, 51)\"><span style=\"color: rgb(103, 103, 103);background-color:#EEEEEE\"><span style=\"color: rgb(51, 51, 51)\"><span style=\"color: rgb(103, 103, 103)\">筛查剂量&lt;1msv，真正的低剂量，甚至低于天然辐射；选择性地屏蔽对女性乳腺等辐射敏感器官、婴幼儿检查部位以外器官的直接照射，更加安全。</span></span></span></span></p><p style=\"word-wrap: break-word\"><span style=\"font-size: 14px;color: rgb(51, 51, 51)\"><span style=\"color: rgb(103, 103, 103);background-color:#EEEEEE\"><span style=\"color: rgb(51, 51, 51)\"><span style=\";font-weight:bold;background-color:#EEEEEE\"><strong>5、无需控制心率</strong></span><br/></span></span></span></p><p style=\"word-wrap: break-word\"><span style=\"font-size: 14px;color: rgb(51, 51, 51)\"><span style=\"color: rgb(103, 103, 103);background-color:#EEEEEE\"><span style=\"color: rgb(51, 51, 51)\"><span style=\"color: rgb(103, 103, 103)\">无需屏气和反复呼吸训练，减少因呼吸运动导致的检查失败。早搏、心率不齐者及儿童、老年人等不能配合屏气者也可检查。</span></span></span></span></p><p style=\"word-wrap: break-word\"><span style=\"font-size: 16px\"><span style=\"color: rgb(51, 127, 229)\"><strong>临床应用</strong></span></span></p><p style=\"word-wrap: break-word\"><span style=\"font-size: 14px;color: rgb(51, 127, 229)\"><span style=\"color: rgb(51, 51, 51)\">冠状动脉CTA、脑血管CTA、颈血管CTA、肺血管CTA、主动脉CTA、上下肢CTA、肾血管CTA、泌尿系CT造影（CTU）、胸部低剂量CT筛查、冠脉钙化积分评估、全身各部位的常规检查</span><span style=\"color: rgb(51, 51, 51)\">。</span></span></p><p style=\"word-wrap: break-word\"><br/></p></strong></p>', '4', '1', 'xiaorun@uvclinic.cn', null, null, null, null, '21', null);
INSERT INTO `shwap_article` VALUES ('27', '周康荣', '医学影像泰斗级人物《CT诊断学》教授《核磁诊断学 》', '20180511/f02548352a7bb5f8e0f28d9842e82638.png', '3', '教授', '医学影像泰斗级人物', null, '1525234804', null, '7', '<p>主任医师 教授 博士生导师<br/>医学影像诊断学界泰斗级人物<br/>上海市医学影像研究所原所长<br/>复旦大学附属中山医院放射科和影像教研室原主任<br/>第五届上海市“医学荣誉奖”获得者<br/>第一和通讯作者发表论文453篇，主编CT、MRI等专著11部<br/>获国家科技成果二等奖一项（国家放射专业首次）<br/>上海市科技成果一等奖二项，总共获奖18项<br/>获国家自然科学基金及重点基金共1000余万元<br/></p>', '1', '1', 'xiaorun@uvclinic.cn', null, null, null, null, null, '1527498210');
INSERT INTO `shwap_article` VALUES ('30', 'PET/MR', '全景继2015年引进上海首台PET/MR(研究型)之后，2017年再次引入华南地区首台PET/MR(研究型)。', '20180503/ae57c677bd6f9c0955e51efb45641d67.jpg', '4', null, null, '正电子发射及磁共振成像系统', '1525235560', null, '12', '<p style=\"word-wrap: break-word;font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;white-space: normal\"><span style=\"font-size: 14px\"><span style=\"line-height: 1.5\">全景继</span></span><span style=\"font-size: 14px;line-height: 1.5\">2015</span><span style=\"font-size: 14px;line-height: 1.5\">年引进上海首台</span><span style=\"font-size: 14px;line-height: 1.5\">PET/MR(</span><span style=\"font-size: 14px;line-height: 1.5\">研究型</span><span style=\"font-size: 14px;line-height: 1.5\">)</span><span style=\"font-size: 14px;line-height: 1.5\">之后，</span><span style=\"font-size: 14px;line-height: 1.5\">2017</span><span style=\"font-size: 14px;line-height: 1.5\">年再次引入华南地区首台</span><span style=\"font-size: 14px;line-height: 1.5\">PET/MR(</span><span style=\"font-size: 14px;line-height: 1.5\">研究型</span><span style=\"font-size: 14px;line-height: 1.5\">)</span><span style=\"font-size: 14px;line-height: 1.5\">。</span><span style=\"font-size: 14px;line-height: 1.5\">PET/MR(</span><span style=\"font-size: 14px;line-height: 1.5\">研究型</span><span style=\"font-size: 14px;line-height: 1.5\">)</span><span style=\"font-size: 14px;line-height: 1.5\">是全球公认的在恶性肿瘤、神经系统疾病的早期筛查和诊断上最有效的医学影像设备之一。可早期发现、精准探测细微癌症。</span><span style=\"font-size: 14px;line-height: 1.5\">PET/MR</span><span style=\"font-size: 14px;line-height: 1.5\">（研究型）将两次检查——正电子扫描（</span><span style=\"font-size: 14px;line-height: 1.5\">PET</span><span style=\"font-size: 14px;line-height: 1.5\">）和磁极共振照影术（</span><span style=\"font-size: 14px;line-height: 1.5\">MR</span><span style=\"font-size: 14px;line-height: 1.5\">），合并为一次，可缩短检查时间，同时获取全身</span><span style=\"font-size: 14px;line-height: 1.5\">MR</span><span style=\"font-size: 14px;line-height: 1.5\">和</span><span style=\"font-size: 14px;line-height: 1.5\">PET</span><span style=\"font-size: 14px;line-height: 1.5\">数据，是医学成像领域的巨大飞跃，为诊断和了解疾病开启了新的大门。它在临床医学的应用主要集中于恶性肿瘤、神经系统、心血管系统三大领域。</span></p><p style=\"word-wrap: break-word;font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;white-space: normal\"><strong><span style=\"font-size: 16px;line-height: 1.5\">PET/MR</span></strong><strong><span style=\"font-size: 16px;line-height: 1.5\">（研究型）的技术优势</span></strong></p><p style=\"word-wrap: break-word;font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;white-space: normal\"><strong><span style=\"font-size: 14px;line-height: 1.5\">1</span></strong><strong><span style=\"font-size: 14px;line-height: 1.5\">、强大的查体功能</span></strong></p><p style=\"word-wrap: break-word;font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;white-space: normal\"><span style=\"font-size: 14px;line-height: 1.5\"><span style=\"line-height: 1.5\">&nbsp; &nbsp; &nbsp;&nbsp;</span><span style=\"line-height: 1.5\">可早期筛查出</span></span><span style=\"font-size: 14px;line-height: 1.5\">2mm</span><span style=\"font-size: 14px;line-height: 1.5\">以上癌症病变和其他重大疾病；全身一次检查便可发现全身是否存在危险的微小病灶。早期诊断可以使患者能够真正的得到早期治疗并为彻底治愈创造了条件，定期的</span><span style=\"font-size: 14px;line-height: 1.5\">PET/MR</span><span style=\"font-size: 14px;line-height: 1.5\">健康检查可发现一些无症状的早期疾病。</span></p><p style=\"word-wrap: break-word;font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;white-space: normal\"><strong><span style=\"font-size: 14px;line-height: 1.5\">2</span></strong><strong><span style=\"font-size: 14px;line-height: 1.5\">、舒适的检查体验</span></strong></p><p style=\"word-wrap: break-word;font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;white-space: normal\"><span style=\"font-size: 14px\"><span style=\"line-height: 1.5\">&nbsp; &nbsp; &nbsp;&nbsp;</span><span style=\"line-height: 1.5\">检查时间降低到分体式设备的一半，更好的舒适体验；</span></span></p><p style=\"word-wrap: break-word;font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;white-space: normal\"><strong><span style=\"font-size: 14px;line-height: 1.5\">3</span></strong><strong><span style=\"font-size: 14px;line-height: 1.5\">、人性化设计的完善</span></strong></p><p style=\"word-wrap: break-word;font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;white-space: normal\"><span style=\"font-size: 14px\"><span style=\"line-height: 1.5\">&nbsp; &nbsp; &nbsp;&nbsp;</span><span style=\"line-height: 1.5\">超大孔径和降噪设计，提升受检时的舒适感。</span></span></p><p style=\"word-wrap: break-word;font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;white-space: normal\"><strong><span style=\"font-size: 14px;line-height: 1.5\">4</span></strong><strong><span style=\"font-size: 14px;line-height: 1.5\">、绿色健康的新技术</span></strong></p><p style=\"word-wrap: break-word;font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;white-space: normal\"><span style=\"font-size: 14px\"><span style=\"line-height: 1.5\">&nbsp; &nbsp; &nbsp;&nbsp;</span><span style=\"line-height: 1.5\">相比</span></span><span style=\"font-size: 14px;line-height: 1.5\">PET/CT</span><span style=\"font-size: 14px;line-height: 1.5\">检查，可减少</span><span style=\"font-size: 14px;line-height: 1.5\">80%</span><span style=\"font-size: 14px;line-height: 1.5\">以上的辐射量。检查大幅度减低了放射线对人体的损伤，因为</span><span style=\"font-size: 14px;line-height: 1.5\">MR</span><span style=\"font-size: 14px;line-height: 1.5\">对人体无任何放射损伤。因此，</span><span style=\"font-size: 14px;line-height: 1.5\">PET/MR</span><span style=\"font-size: 14px;line-height: 1.5\">是最佳的体检和诊断设备。</span></p><p><br/></p>', '1', '1', 'xiaorun@uvclinic.cn', null, null, null, null, null, '1527498217');
INSERT INTO `shwap_article` VALUES ('31', 'PET/CT检查注意事项', '请您务必提前2-3天致电中心进行预约，并在检查当日携带好身份证及各类病史记录', '20180502/a4297a617bcbaf538697309200b3da1d.jpg', '5', null, null, null, '1525235682', null, '2', '<p>该套餐运用先进的乳腺彩超+钼靶+磁共振全方位扫描模式，结合临床乳腺临床专家联合会诊，可明显提高乳腺癌等妇科疾病的早期检出率。磁共振扫描技术良好的软组织对比分辨率，任意方位成像，丰富的成像序列技术可以提高更多的诊断信息，对盆腔肿瘤有独特的诊断优势 ，对畸胎瘤、子宫肌瘤、子宫内膜异位症、卵巢囊肿的定型诊断准确率很高。</p>', '1', '1', 'xiaorun@uvclinic.cn', null, null, null, null, null, '1527498224');
INSERT INTO `shwap_article` VALUES ('37', 'PET/CT', 'PET-CT将PET与CT完美融为一体，由PET提供病灶详尽的功能与代谢等分子信息，而CT提供病灶的精确解剖定位', '20180503/3ef25b0ff6facb04ca1ae7ea89ff8037.jpg', '4', null, null, 'PET/CT', '1525311889', null, '0', '<p style=\"word-wrap: break-word;font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;white-space: normal\"><span style=\"font-size: 14px\"><span style=\"line-height: 1.5\">全景继</span></span><span style=\"font-size: 14px;line-height: 1.5\">2015</span><span style=\"font-size: 14px;line-height: 1.5\">年引进上海首台</span><span style=\"font-size: 14px;line-height: 1.5\">PET/MR(</span><span style=\"font-size: 14px;line-height: 1.5\">研究型</span><span style=\"font-size: 14px;line-height: 1.5\">)</span><span style=\"font-size: 14px;line-height: 1.5\">之后，</span><span style=\"font-size: 14px;line-height: 1.5\">2017</span><span style=\"font-size: 14px;line-height: 1.5\">年再次引入华南地区首台</span><span style=\"font-size: 14px;line-height: 1.5\">PET/MR(</span><span style=\"font-size: 14px;line-height: 1.5\">研究型</span><span style=\"font-size: 14px;line-height: 1.5\">)</span><span style=\"font-size: 14px;line-height: 1.5\">。</span><span style=\"font-size: 14px;line-height: 1.5\">PET/MR(</span><span style=\"font-size: 14px;line-height: 1.5\">研究型</span><span style=\"font-size: 14px;line-height: 1.5\">)</span><span style=\"font-size: 14px;line-height: 1.5\">是全球公认的在恶性肿瘤、神经系统疾病的早期筛查和诊断上最有效的医学影像设备之一。可早期发现、精准探测细微癌症。</span><span style=\"font-size: 14px;line-height: 1.5\">PET/MR</span><span style=\"font-size: 14px;line-height: 1.5\">（研究型）将两次检查——正电子扫描（</span><span style=\"font-size: 14px;line-height: 1.5\">PET</span><span style=\"font-size: 14px;line-height: 1.5\">）和磁极共振照影术（</span><span style=\"font-size: 14px;line-height: 1.5\">MR</span><span style=\"font-size: 14px;line-height: 1.5\">），合并为一次，可缩短检查时间，同时获取全身</span><span style=\"font-size: 14px;line-height: 1.5\">MR</span><span style=\"font-size: 14px;line-height: 1.5\">和</span><span style=\"font-size: 14px;line-height: 1.5\">PET</span><span style=\"font-size: 14px;line-height: 1.5\">数据，是医学成像领域的巨大飞跃，为诊断和了解疾病开启了新的大门。它在临床医学的应用主要集中于恶性肿瘤、神经系统、心血管系统三大领域。</span></p><p style=\"word-wrap: break-word;font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;white-space: normal\"><strong><span style=\"font-size: 16px;line-height: 1.5\">PET/MR</span></strong><strong><span style=\"font-size: 16px;line-height: 1.5\">（研究型）的技术优势</span></strong></p><p style=\"word-wrap: break-word;font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;white-space: normal\"><strong><span style=\"font-size: 14px;line-height: 1.5\">1</span></strong><strong><span style=\"font-size: 14px;line-height: 1.5\">、强大的查体功能</span></strong></p><p style=\"word-wrap: break-word;font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;white-space: normal\"><span style=\"font-size: 14px;line-height: 1.5\"><span style=\"line-height: 1.5\">&nbsp; &nbsp; &nbsp;&nbsp;</span><span style=\"line-height: 1.5\">可早期筛查出</span></span><span style=\"font-size: 14px;line-height: 1.5\">2mm</span><span style=\"font-size: 14px;line-height: 1.5\">以上癌症病变和其他重大疾病；全身一次检查便可发现全身是否存在危险的微小病灶。早期诊断可以使患者能够真正的得到早期治疗并为彻底治愈创造了条件，定期的</span><span style=\"font-size: 14px;line-height: 1.5\">PET/MR</span><span style=\"font-size: 14px;line-height: 1.5\">健康检查可发现一些无症状的早期疾病。</span></p><p style=\"word-wrap: break-word;font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;white-space: normal\"><strong><span style=\"font-size: 14px;line-height: 1.5\">2</span></strong><strong><span style=\"font-size: 14px;line-height: 1.5\">、舒适的检查体验</span></strong></p><p style=\"word-wrap: break-word;font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;white-space: normal\"><span style=\"font-size: 14px\"><span style=\"line-height: 1.5\">&nbsp; &nbsp; &nbsp;&nbsp;</span><span style=\"line-height: 1.5\">检查时间降低到分体式设备的一半，更好的舒适体验；</span></span></p><p style=\"word-wrap: break-word;font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;white-space: normal\"><strong><span style=\"font-size: 14px;line-height: 1.5\">3</span></strong><strong><span style=\"font-size: 14px;line-height: 1.5\">、人性化设计的完善</span></strong></p><p style=\"word-wrap: break-word;font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;white-space: normal\"><span style=\"font-size: 14px\"><span style=\"line-height: 1.5\">&nbsp; &nbsp; &nbsp;&nbsp;</span><span style=\"line-height: 1.5\">超大孔径和降噪设计，提升受检时的舒适感。</span></span></p><p style=\"word-wrap: break-word;font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;white-space: normal\"><strong><span style=\"font-size: 14px;line-height: 1.5\">4</span></strong><strong><span style=\"font-size: 14px;line-height: 1.5\">、绿色健康的新技术</span></strong></p><p style=\"word-wrap: break-word;font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;white-space: normal\"><span style=\"font-size: 14px\"><span style=\"line-height: 1.5\">&nbsp; &nbsp; &nbsp;&nbsp;</span><span style=\"line-height: 1.5\">相比</span></span><span style=\"font-size: 14px;line-height: 1.5\">PET/CT</span><span style=\"font-size: 14px;line-height: 1.5\">检查，可减少</span><span style=\"font-size: 14px;line-height: 1.5\">80%</span><span style=\"font-size: 14px;line-height: 1.5\">以上的辐射量。检查大幅度减低了放射线对人体的损伤，因为</span><span style=\"font-size: 14px;line-height: 1.5\">MR</span><span style=\"font-size: 14px;line-height: 1.5\">对人体无任何放射损伤。因此，</span><span style=\"font-size: 14px;line-height: 1.5\">PET/MR</span><span style=\"font-size: 14px;line-height: 1.5\">是最佳的体检和诊断设备。</span></p><p><br/></p>', '2', '1', 'xiaorun@uvclinic.cn', null, null, null, null, null, null);
INSERT INTO `shwap_article` VALUES ('38', 'FLASH双源CT', 'FLASH双源CT是目前世界上最先进的CT设备之一，其扫描速度更快；辐射剂量极低（小于1mSV）', '20180503/e789fd40e74e738f89a4bdcc2989c873.jpg', '4', null, null, 'FLASH双源CT', '1525312066', null, '0', '<p style=\"word-wrap: break-word;font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;white-space: normal\"><span style=\"font-size: 14px;line-height: 1.5\">&nbsp;FLASH</span><span style=\"font-size: 14px;line-height: 1.5\">双源</span><span style=\"font-size: 14px;line-height: 1.5\">CT</span><span style=\"font-size: 14px;line-height: 1.5\">是目前世界上最先进的</span><span style=\"font-size: 14px;line-height: 1.5\">CT</span><span style=\"font-size: 14px;line-height: 1.5\">设备之一，其扫描速度更快；辐射剂量极低（小于</span><span style=\"font-size: 14px;line-height: 1.5\">1mSV</span><span style=\"font-size: 14px;line-height: 1.5\">）；图像质量高，不受呼吸运动的影响；</span><span style=\"font-size: 14px;line-height: 1.5\">4D</span><span style=\"font-size: 14px;line-height: 1.5\">动态</span><span style=\"font-size: 14px;line-height: 1.5\">800</span><span style=\"font-size: 14px;line-height: 1.5\">排大螺距扫描，实现大范围的动脉灌注功能成像；双能扫描纯谱等独具匠心的技术优势，使其在临床上的应用如雨后春笋、方兴未艾！</span></p><p style=\"word-wrap: break-word;font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;white-space: normal\"><span style=\"font-size: 14px;line-height: 1.5\">&nbsp; &nbsp; &nbsp; FLASH</span><span style=\"font-size: 14px;line-height: 1.5\">双源</span><span style=\"font-size: 14px;line-height: 1.5\">CT</span><span style=\"font-size: 14px;line-height: 1.5\">主要用于心脑血管系统疾病的筛查，在无创的情况下可清晰显示血管腔的狭窄、血管壁的斑块性质及先天性变异；无需控制心率即能获得高质量图像。</span></p><p style=\"word-wrap: break-word;font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;white-space: normal\"><span style=\"font-size: 14px;line-height: 1.5\">&nbsp; &nbsp; &nbsp; 心脑血管病是一种严重威胁人类特别是中老年人健康的常见疾病，猝死病人中九成源于心脑血管疾病，防患于未然，</span><span style=\"font-size: 14px;line-height: 1.5\">FLASH</span><span style=\"font-size: 14px;line-height: 1.5\">双源</span><span style=\"font-size: 14px;line-height: 1.5\">CT</span><span style=\"font-size: 14px;line-height: 1.5\">的出现让无创伤、精准、安全筛查心脑血管疾病成为可能</span><span style=\"font-size: 14px;line-height: 1.5\">,</span><span style=\"font-size: 14px;line-height: 1.5\">从而早期发现、早期诊断、早期治疗。</span></p><p><br/></p>', '3', '1', 'xiaorun@uvclinic.cn', null, null, null, null, null, null);
INSERT INTO `shwap_article` VALUES ('39', 'MR', '对颅脑、甲状腺、乳腺、肝、胆、胰、脾、肾、肾上腺、子宫、卵巢、前列腺、脊柱脊髓等器官的疾病', '20180503/6bffda96fbc4797ef71ba5c33d97256d.jpg', '4', null, null, 'MR', '1525312110', null, '1', '<p style=\"word-wrap: break-word;font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;white-space: normal\"><span style=\"font-size: 14px;line-height: 1.5\">上海全景中心引进的先进的德国西门子</span><span style=\"font-size: 14px;line-height: 1.5\">SKYRA&nbsp;</span><span style=\"font-size: 14px;line-height: 1.5\">核磁共振采用大孔径短磁体设计、能够获得更高质量图像、可进行高质量的全身大范围磁共振一次性成像、具有丰富的扫描检查模式、大量应用于全身各部位的功能成像显示器官的功能和代谢变化，以及强大的血管检查功能等特点。</span></p><p style=\"word-wrap: break-word;font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;white-space: normal\"><span style=\"font-size: 14px;line-height: 1.5\">&nbsp; &nbsp; &nbsp; 磁共振成像具有无射线、成像参数多、多方位成像，不用对比剂可进行血管或水成像，在脑、脊髓、椎间盘检查中具有不可取代的优势，骨关节系统显示病变敏感，软骨及软组织分辨好等特点。对颅脑、甲状腺、乳腺、肝、胆、胰、脾、肾、肾上腺、子宫、卵巢、前列腺、脊柱脊髓等器官的疾病有绝佳的诊断功能，也使恶性肿瘤、心脏及脑血管疾病无所遁形。</span></p><p><br/></p>', '4', '1', 'xiaorun@uvclinic.cn', null, null, null, null, null, null);
