INSERT INTO `shwap_config` VALUES ('1', '全景医学上海中心手机站', '全景医学影像诊断中心上海手机站', '全景医学影像诊断中心上海手机站', '400-920-8393', '上海市徐汇区桂林路406号华鑫中心8号楼', '20180427/5a5073e76575c9a7d6fce999def95770.jpg', '20180511/21c2022ab225f8f099dea06961dddebb.png', '<p style=\"white-space: normal;\">本协议是您与爱康集团之间就使用爱康集团服务共同签署的契约，请您仔细阅读本协议！您在申请注册流程中，点击同意本协议之前，应当认真阅读本协议。请您务必审慎阅读、充分理解各条款内容，特别是免除或者限制责任的条款、法律适用和争议解决条款，您应重点阅读。如您对协议有任何疑问，可向爱康集团客服咨询。</p><p style=\"white-space: normal;\">当您按照注册页面提示填写信息、阅读并同意本协议且完成全部注册程序后，即表示您已充分阅读、理解并接受本协议的全部内容，并与爱康集团达成一致，成为爱康集团用户。阅读本协议的过程中，如果您不同意本协议或其中任何条款约定，您应立即停止注册程序。</p><p style=\"white-space: normal;\">爱康集团：包含爱康商城、体检宝、MIS等网站及客户端；</p><p style=\"white-space: normal;\">一、注册使用</p><p style=\"white-space: normal;\">1.1用户资格</p><p style=\"white-space: normal;\">您确认，在您开始注册程序使用爱康集团服务前，您应当具备中华人民共和国法律规定的与您行为相适应的民事行为能力。若您不具备前述与您行为相适应的民事行为能力，则您及您的监护人应依照法律规定承担因此而导致的一切后果，且本网站有权注销您的账号，并向您及您的监护人索偿。</p><p><br/></p>');
